import React from 'react';
import logo from './logo.svg';
import './App.css';
import WelcomeClass from './jsx/WelcomClass';
import Welcome from './jsx/Welcome';
import Clock from './jsx/Clock';

function App() {
  return (
    <div className="App">
      <header className="App-header">
        <img src={logo} className="App-logo" alt="logo" />
        <p>
          Edit <code>src/App.js</code> and save to reload.
        </p>
        <a
          className="App-link"
          href="https://reactjs.org"
          target="_blank"
          rel="noopener noreferrer"
        >
          Learn React
        </a>
        <WelcomeClass name="Guru Sri Raghvendra" />
        <Welcome name="Guru Sri Raghvendra"/>
        <Clock />
      </header>
    </div>
  );
}

export default App;
